리뷰내용:
@장점: 차콜 핑크 조합이라 핑크카고팬츠에 찰떡입니다. 나비 자수 귀엽고 등은 더 귀여움. 직진배송 12시간만에 옴. 
@애매한 점: 겨드랑이 찡기는거 싫어서 레귤러핏 삼. 목쪽에 M사이즈라 적혀있는데 체감상 배에 여유있는 S사이즈같음. 평소 어좁이에 체구 작단 소리 많이
듣는 상체인데도 어깨선과 가슴이 딱맞음. 가슴은 딱맞는데 허리는 여유있으니까 가슴브터 허리까지 통으로 떨어짐. 완전 제대로 크롭기장이 아니다보니 통자 허리로 보여버림. 저는 기장을 자르든지 옆구리에 셔링을 잡든지 해야겠어요. 
@단점: 목이 바로 늘어남! 한 번 피팅한건데 목늘어남! 바로그냥 우레탄줄 껴버렸슴다. 예쁘니까 오래가자 우리…
